function 保存(路径, 数据) {
    try {
        var 文件 = new java.io.File(路径)
        var 写入 = new java.io.FileWriter(文件);
        写入.write(数据)
        写入.close();
    } catch (e) {
        print("写入:" + e)
    }
}

